  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code_user` varchar(255) NOT NULL DEFAULT '',
  `code_income` varchar(255) NOT NULL DEFAULT '',
  `activity` int(11) NOT NULL DEFAULT '0',
  `cash_in` int(11) NOT NULL DEFAULT '0',
  `cash_out` int(11) NOT NULL DEFAULT '0',
  `coin_in` int(11) NOT NULL DEFAULT '0',
  `coin_out` int(11) NOT NULL DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `Income Key` (`code_income`),
  UNIQUE KEY `Lock` (`code_user`,`code_income`),
  UNIQUE KEY `User Key` (`code_user`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC COMMENT='container data every an outcome mutation invoke';

