DROP TABLE IF EXISTS `user_wallet_stats`;
CREATE TABLE `user_wallet_stats` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code_user` varchar(255) NOT NULL DEFAULT '',
  `code_stats` varchar(255) NOT NULL DEFAULT '',
  `activity` int(11) NOT NULL DEFAULT '0',
  `premium` int(11) NOT NULL DEFAULT '0' COMMENT 'COUNT',
  `normal` int(11) NOT NULL DEFAULT '0' COMMENT 'COUNT',
  `star` int(11) NOT NULL DEFAULT '0' COMMENT 'AVG = (A[4]+B[3]+C[2]+D[1])/4',
  `cash` int(11) NOT NULL DEFAULT '0' COMMENT 'SUM',
  `coin` int(11) NOT NULL DEFAULT '0' COMMENT 'SUM',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT 'SUM',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `Lock` (`code_user`,`code_stats`),
  UNIQUE KEY `Stats Key` (`code_stats`),
  UNIQUE KEY `User Key` (`code_user`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC COMMENT='container data every a state mutation (game) invoked';

